import './App.scss';
import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Layout from './Components/Layout';
import Home from './Components/Home';

function App() {
  return (
    <Router>    
        <div>
            <Routes>
                 <Route path="/" element={<Layout />} />
            </Routes>
      </div>
    </Router>
  );
}


export default App
